import React from "react";
import "./Create_Event.css";

export default function Create_Event() {
    return (
        <section className="Create_Event_plate">
            <div className="Create_Event_Inputs">
                <input className="Create_Event_Inputs_Header" type="text" placeholder="Header" />
                <input className="Create_Event_Inputs_Description" type="text" placeholder="desctiption" />
                 <input className="Create_Event_Inputs_Data&Time" type="datetime-local" />
                <input className="Create_Event_Inputs_CreateButton" type="button" value="create" />
            </div>
        </section>
    );
}
